import Navbar from "../Global/Navbar/Navbar";
import { Fragment } from "react";
const ContactPage = () => {
  return (
    <div>
       <Fragment>
       <Navbar />
      <h1>Contact Page</h1>
      <p>Phone: 123-456-7890</p>
      <p>Email: yak.king</p>
      <div style="width: 100%; height: 100%; background: #071C32"></div>
      <div style={{width: '100%', height: '100%', flexDirection: 'column', justifyContent: 'center', alignItems: 'center', gap: 16, display: 'inline-flex'}}>
    <div style={{paddingTop: 10, paddingBottom: 10, justifyContent: 'center', alignItems: 'center', gap: 10, display: 'inline-flex'}}>
        <div style={{width: 793, height: 76, textAlign: 'center', color: 'white', fontSize: 36, fontFamily: 'Oldschool Grotesk Trial', fontWeight: '500', lineHeight: 41.29, wordWrap: 'break-word'}}>You don’t have to navigate the complexities of international fee payments alone. </div>
    </div>
    <div style={{width: 814, height: 134, textAlign: 'center', color: 'white', fontSize: 18, fontFamily: 'Oldschool Grotesk Trial', fontWeight: '350', lineHeight: 24.61, wordWrap: 'break-word'}}>We’re here to assist you every step of the way. From questions to assistance, or maybe you simply want to connect, we’re just a click or a call away. We look forward to helping you on your journey.<br/><br/>You don’t have to navigate the complexities of international tuition payments alone. We’re here to assist you every step of the way. From questions to assistance, or maybe you simply want to connect, we’re just a click or a call away.</div>
</div>
      </Fragment>
    </div>
  );
};

export default ContactPage;
